import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <Link to="/post">
        <button>글작성</button>
      </Link>

      <div>
        {posts.map((post) => (
          <div key={post.id}>
            <h2>{post.title}</h2>
            <div dangerouslySetInnerHTML={{ __html: post.body }} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
